  `major_id` int(11) NOT NULL COMMENT '所属专业ID',
  `college_id` int(11) NOT NULL COMMENT '所属学院ID',
  `university_id` int(11) DEFAULT NULL COMMENT '所属学校ID',
  `school_type` varchar(512) DEFAULT NULL COMMENT '学校类型',
  `project_name` varchar(64) DEFAULT NULL COMMENT '毕设名称',
  `project_detail` varchar(64) DEFAULT NULL COMMENT '毕设描述',
  `stu_name` varchar(32) NOT NULL COMMENT '学生姓名',
  `stu_phone` varchar(11) NOT NULL COMMENT '学生手机号',
  `stu_qq` varchar(20) DEFAULT '' COMMENT '学生QQ号',
  `stu_email` varchar(128) DEFAULT NULL COMMENT '学生邮箱',
  `stu_education` int(2) NOT NULL COMMENT '学历1本科，2研究生，3大专 ，4 博士',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `state` int(1) NOT NULL COMMENT '学生状态',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`stu_id`) USING BTREE,
  KEY `university_id` (`university_id`) USING BTREE,
  KEY `college_id` (`college_id`) USING BTREE,
  KEY `major_id` (`major_id`) USING BTREE,
  KEY `class_id` (`class_id`) USING BTREE,
  CONSTRAINT `stu_ibfk_1` FOREIGN KEY (`university_id`) REFERENCES `university` (`university_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `stu_ibfk_2` FOREIGN KEY (`college_id`) REFERENCES `college` (`college_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `stu_ibfk_3` FOREIGN KEY (`major_id`) REFERENCES `major` (`major_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `stu_ibfk_4` FOREIGN KEY (`class_id`) REFERENCES `class` (`class_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=31 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

